  false,\n\t\"url\": null,\n\t\"notes\": \"A Breeding Bird Survey (BBS) was conducted
  in the Devils Lake Wetland Management District (DLWMD) during the late spring and
  early summer of 2003. The DLWMD contains an interspersion of wetland, grassland
  and intensively cropped agricultural land, located in northeastern North Dakota.
  The objective of this study was to survey and determine temporal trends and frequency
  of detection of 43 targeted shorebird, waterbird and grassland bird species, and
  obtain biological information to be used in the DLWMD's Comprehensive Conservation
  Plan (CCP).\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
